  `PAC_CODIGO` int(11) DEFAULT NULL,
  `RES_CODIGO` smallint(6) DEFAULT NULL,
  `UNM_CODIGO` smallint(6) DEFAULT NULL,
  `TRA_SISTEMA` enum('publico','privado') DEFAULT 'publico',
